import React from "react";

export default function Home() {
  return (
    <div className="min-h-screen flex flex-col">
      {/* Hero background */}
      <div
        className="h-[80vh] bg-no-repeat bg-center bg-contain"
        style={{
          backgroundImage: "url('/background_main1.png')",
          backgroundSize: "25%", // Slight zoom out (try 70%–80%)
          backgroundRepeat: "no-repeat",
          backgroundPosition: "center top",
        }}
      >
        {/* Optional content inside the background later */}
      </div>

      {/* White section begins after image */}
      <div className="flex-1 bg-white">
        {/* You’ll place 'Who We Are', Contact, etc here later */}
      </div>
    </div>
  );
}
